import json
import base64
from PIL import Image
import numpy as np
import cv2
from io import BytesIO
import matplotlib
matplotlib.use('TkAgg')
import matplotlib.pyplot as plt

def decode_base64_to_pil(base64_str):
    img_data = base64.b64decode(base64_str)
    image = Image.open(BytesIO(img_data))
    return image

def clean_b64(b64_str):
    if ',' in b64_str:
        return b64_str.split(',')[1]
    return b64_str

def recognition(big_image_b64:str,small_image_b64:str,to_figure:bool)->list:
    small_b64 = clean_b64(small_image_b64)
    big_b64   = clean_b64(big_image_b64)

    small_ori_img = decode_base64_to_pil(small_b64)

    # Base64 解码
    small_data = base64.b64decode(small_b64)
    big_data   = base64.b64decode(big_b64)

    # 转为 numpy 数组
    np_small = np.frombuffer(small_data, np.uint8)
    np_big   = np.frombuffer(big_data, np.uint8)

    # 解码为灰度图
    small_img = cv2.imdecode(np_small, cv2.IMREAD_GRAYSCALE)  # 滑块图（小）
    big_img   = cv2.imdecode(np_big, cv2.IMREAD_GRAYSCALE)    # 背景图（大）

    part_width = 20
    # cut_width
    parts = []
    for i in range(3):
        parts.append(small_img[:, i*5+i*part_width:i*5+(i+1)*part_width])

    edges_parts = []
    # 对每部分和背景图进行边缘检
    for part in parts:
        edges_parts.append(cv2.Canny(cv2.resize(part, (32, 32), interpolation=cv2.INTER_AREA), 0,00))
    edges_background = cv2.Canny(big_img, 80, 255)

    if to_figure:

        plt.figure(figsize=(15, 10))  # 调整窗口大小以适应更多的子图

        # 可视化分割部分的边缘
        for idx, edges_part in enumerate(edges_parts):
            plt.subplot(2, 3, idx + 1)  # 第一行用于显示各部分的边缘
            plt.imshow(edges_part, cmap='gray')
            plt.title(f'Edges of Part {idx + 1}')
            plt.axis('off')

        # 可视化背景图像的边缘
        plt.subplot(2, 3, 4)  # 在第二行的第一个位置显示背景图像的整体边缘
        plt.imshow(edges_background, cmap='gray')
        plt.title('Edges of Background Image')
        plt.axis('off')
        plt.subplot(2, 3, 5)  # 在第二行的第一个位置显示背景图像的整体边缘
        plt.imshow(small_ori_img)
        plt.title('Icon Image')
        plt.axis('off')

        # 如果需要在第二行剩余的空间展示其他信息或保持布局的一致性，可以添加空的子图
        for i in range(2):  # 添加两个空的子图
            plt.subplot(2, 3, 5 + i)
            plt.axis('off') 

        plt.show(block=True)  # 显示所有子图
    
    
    res = []
    # 在背景图像中匹配每个部分
    for idx, edges_part in enumerate(edges_parts):
        a = edges_background.copy()
        b = edges_part.copy()
        cv2.normalize(a, a, 0, 1, cv2.NORM_MINMAX)
        cv2.normalize(b, b, 0, 1, cv2.NORM_MINMAX)
        result = cv2.matchTemplate(a, b, cv2.TM_CCOEFF)
        min_val, max_val, min_loc, max_loc = cv2.minMaxLoc(result)
        h, w = edges_part.shape
        res.append(max_loc[0]+w//2)
        res.append(max_loc[1]+h//2)

        print(f"Part {idx + 1} matched at: {max_loc},score:"+str(max_val))
        if to_figure:
            # 获取模板的宽度和高度
            
            
            # 在原图上画出匹配到的区域
            top_left = max_loc
            bottom_right = (top_left[0] + w, top_left[1] + h)
            cv2.rectangle(big_img, top_left, bottom_right, (0, 255, 0), 2)  # 使用绿色边框标记匹配区域

            # 在匹配区域附近写上序号
            font = cv2.FONT_HERSHEY_SIMPLEX
            text = f'{idx + 1}'
            text_size = cv2.getTextSize(text, font, 1, 2)[0]  # 获取文本尺寸
            
            # 计算文本放置的位置，使其位于矩形上方居中
            text_x = top_left[0] + (w - text_size[0]) // 2
            text_y = top_left[1] - 10  # 留出一定间隔
            
            # 防止文本超出图片顶部
            if text_y < 30:  # 文本高度加上一定的间隔
                text_y = bottom_right[1] + text_size[1] + 20
            
            # 添加文本
            cv2.putText(big_img, text, (text_x, text_y), font, 1, (0, 255, 0), 2, cv2.LINE_AA)
    if to_figure:
        
        # 使用Matplotlib显示带有标记的背景图像
        plt.figure(figsize=(10, 10))
        plt.subplot(2, 1,  1) 
        plt.imshow(cv2.cvtColor(big_img, cv2.COLOR_BGR2RGB))  # 转换颜色空间以正确显示
        plt.title('Detected Parts on Background Image')
        plt.axis('off')  # 不显示坐标轴


        plt.subplot(2, 1,  2) 
        plt.imshow(small_ori_img)  # 转换颜色空间以正确显示
        plt.title('Icon Image')
        plt.axis('off')  # 不显示坐标轴
        plt.show(block=True)
    return res




